import React from "react";

const InterviewList = () => {
    return (
        <article className="article">
            <h3 className="article__category">NEWS</h3>
            <h2 className="article__title">Snow in Turkey</h2>
            <p className="article__excerpt">Heavy snowstorm in Turkey creates havoc as hundreds of villages</p>
      </article>
    );
};

export default InterviewList;
